import "./buyTransportLicense.scss";
export default {
  data() {
    return {
      active: true,
      availableLicense: [],
      currentLicense: [],
      x: null,
      namespace: null
    };
  },
  methods: {
    setData(data) {
      this.$recursiveAssign(data, this.$data);
    },
    getLicenseExist(type) {
      return this.currentLicense.includes(type);
    },
    getLicenseImage(image) {
      return `https://cdn.nexus-rp.net/buyTransportLicense/${image}`;
    },
    buyLicense(license) {
      this.$callClient('C:TransportLicense:BuyLicense', license.type);
    },
    onKeyUp(e) {
      if (e.keyCode === 27 && !window.isModalShow) {
        // Escape
        this.AppClose();
      }
    },
    Update(data) {
      this.currentLicense = data;
    },
    AppClose() {
      this.$callClient('C:TransportLicense:Close');
    }
  },
  mounted() {
    window.addEventListener("keyup", this.onKeyUp);
    this.$onClient("W:TransportLicense:setData", this.setData);
    this.$onClient("W:TransportLicense:Update", this.Update);
    this.$callClient("C:TransportLicense:BrowserReady");
  },
  beforeUnmount() {
    window.removeEventListener("keyup", this.onKeyUp);
    this.$offClient("W:TransportLicense:setData", this.setData);
    this.$offClient("W:TransportLicense:Update", this.Update);
  }
};
